import React from "react";
import "./App.css";
import { connect } from "react-redux";

function App() {
  return <div className='App'>Hello {this.props.user}</div>;
}

const mapStateToProps = (state) => {
  return {
    user: state.users.username,
  };
};

export default connect(mapStateToProps)(App);
